import React from 'react'
import Button from 'react-bootstrap/Button';
import './Home.css'

function Home() {
  return (
    <div className='landingPage d-lg-flex justify-content-center align-items-center' style={{height:'100vh'}}>
        <div className='container w-50  text-center'>
            <p className='text-danger' style={{fontSize:'5rem'}}>INSTA QUIZ</p>
            
            <Button className='mt-3 ps-5 pe-5 fs-2 clickPlay'  variant="warning">Let's Play</Button>
        </div>
    </div>
  )
}

export default Home
